import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <>
      <Navbar expand='lg' variant='dark' bg='dark'>
        <Container id='nav-container'>
          <Navbar.Brand>NAVBAR</Navbar.Brand>
          <Form
            className='d-flex'
            onSubmit={(event) => {
              handleSubmit(event.target.value);
            }}>
            <Form.Control
              type='input'
              placeholder='input'
              className='me-2'
              aria-label='Input'
            />
            <Button variant='primary' type='submit'>
              Submit
            </Button>
          </Form>
        </Container>
      </Navbar>
      <div></div>
    </>
  );
}

export default App;
